import React from "react";

function LetfSection({
  imageURL,
  productName,
  prodcutDescription,
  tryDemo,
  learnMore,
  googlePlay,
  appStore,
}) {
  return;
  <div className="container">
    <div className="row">
      <div className="col-6">
        <img src={imageURL} />
      </div>
    </div>
  </div>;
}

export default LetfSection;
